            return (
                <h3 className="productName">
                    <p>TOTAL CLEANSER </p>
                    <p>3DAYS</p>
                </h3>
            )
        } else if (this.props.currPage === 'powder') {
            return (
                <h3 className="productName">
                    <p>CLEANSE  </p>
                    <p>POWDER</p>
                </h3>
            )
        }


